    false,nt"url": null,nt"notes": "The objective of this study was to review
    past use and establish the minimum future water requirements for that portion of
    the Stillwater NWR and Management Area where beneficial use is controlled and has
    been managed effectively. The mean monthly water surface elevations for each marsh
    unit and the subsequent mean monthly surface acreage was obtained from the gauge
    height records and area curves. Consumptive use requirements, mean monthly water
    surface elevation, and gain were also calculated. Diagrams and charts of water deliveries,
    water use, water requirements, consumptive use, optimum water elevations, estimated
    water storage, and wetland acreages are also included. Reports titled u2018The study
    of the aggregate releases of the Carson River below Lahontan Reservoiru2019 and
    u2018Estimated water requirements Stillwater Wildlife Management Areau2019 are attached.",nt"license_title":
